import './welcome.css';


import React from "react";

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function Welcome() {

  function getHouseholds(){

    var xhttp = new XMLHttpRequest();
    xhttp.onload = function() {
        if(this.status==200){
            let response=this.responseText;
            alert(this.status);
        }
    };
    xhttp.open("GET", "http://localhost:8080/api/getHouseholds");
    xhttp.send();

  }  






  return (


      <main className='container top1'>

          <div className='row'>

             <Link to='/transactions'>

                 <button className='col-12 border'>
                    <i class="fas fa-house-user button-img green"></i> <span className='black'>{getHouseholds()}</span> 
                 </button>
                 <div className='col-12 border grey centre'>
                       <i className="far fa-edit"></i>
                 </div>


            </Link>

          </div>

      </main>    
  );
}

export default Welcome;
